package net.pack.leetproblems.distrmatch;

import java.util.ArrayList;
import java.util.Arrays;
import java.util.List;

public class Solution {

    public static void main(String[] args) {
        System.out.println(Arrays.toString(new Solution().diStringMatch("")));
    }

    public int[] diStringMatch(String s){
        Integer[] arr = new Integer[s.length() + 1];
        for(int i = 0; i <= s.length(); i++){
            arr[i] = i;
        }

        Integer[] res = getArr(arr, s);

        List<Integer> indexes = new ArrayList<>();
        for(int j = 0; j <= arr.length; j++){
            indexes.add(j);
        }

        return getArrAndLast(indexes, res);
    }

    private Integer[] getArr(Integer[] arr, String s){
        Integer[] res = new Integer[arr.length];
        int valueI = arr[0];
        int valueD = arr[s.length()];
        int i = 0;
        for(String letter : s.split("")){
            if(letter.equals("I")){
                res[i] = valueI;
                valueI++;
            } else {
                res[i] = valueD;
                valueD--;
            }
            i++;
        }
        return res;
    }

    private int[] getArrAndLast(List<Integer> indexes, Integer[] res){
        indexes.removeAll(Arrays.asList(res));
        res[res.length-1] = indexes.get(0);
        int[] resInt = new int[res.length];
        for(int j = 0; j < res.length; j++){
            resInt[j] = res[j];
        }
        return resInt;
    }
}